import React from "react";
import PropTypes from "prop-types";

const _app = ({ Compoenet }) => {
  return (
    <>
      <Head>
        <meta charSet="utf-8" />
        <title>sns_clone</title>
      </Head>
    </>
  );
};

_app.propTypes = {};

export default _app;
